import Article from "./backend_component/article";
import Sidebar from "./backend_component/sidebar";
import Title from "./backend_component/title";
import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
const Personal=()=>{
    var permession= window.sessionStorage.getItem('permession')
    const navigate=useNavigate()
    const p=['個人年度目標','每月績效','登出']
    useEffect(() => {
        if(permession!=='personal'){
            navigate('/backend')
        }
    });
    return(

    <>
    <div className="head">
        <Title/>
        <Sidebar sidebar_arr={p} style={"lesssmall"} />
        <Sidebar sidebar_arr={p} style={"small"} />
    </div>

    <div className="body">
        <Sidebar sidebar_arr={p} style={"large"}/>
        <Article/>
    </div>
    </>

    )
}
export default Personal;
